import React from 'react';
import Card from './Card';

const CardList = ({robots,id}) =>{
	// using map for looping around the Card details 
	const CardsArray = robots.map((user,i)=>{
			return (<Card 

			 key={id} 
			 id={robots[i].id}
			 name={robots[i].name} 
			 email={robots[i].email} />
	)})
	return(

			<div>
					{CardsArray}
			</div>		


		);

}
		
export default CardList;
